import React from 'react'
import './TrendCard.css'
import {TrendData} from '../../Data/trendData'

const TrendCard = () => {
  return (
    <div className='TrendCard'>
        <h3>trends</h3>
        {TrendData.map((item, index) => {
            return (
                <div className="trendCardItem" key={index}>
                    <div className="trendCardItemLeft">
                        <p>{item.trend}</p>
                        <p>{item.trendNumber}</p>
                    </div>
                    <div className="trendCardItemRight">
                        <p>{item.trendNumber}</p>
                    </div>
                </div>
            )
        })}        
    </div>
  )
}

export default TrendCard
